import re

def merge_acl_for_duplicate_urls(sql_statements):
    # 用於存儲 URL 到其完整 SQL 語句的映射
    url_to_sql = {}
    # 用於存儲 URL 到其 ACL 列表的映射
    url_to_acls = {}
    
    # 正則表達式來提取 URL 和 ACL
    # 修改正則表達式以匹配 VALUES 後面的值
    url_pattern = re.compile(r"VALUES\s*\([^,]*,\s*'(/[^']*)'")
    acl_pattern = re.compile(r"VALUES\s*\([^,]*,[^,]*,\s*'(ACL[^']*)'")
    
    # 解析每個 SQL 語句
    for sql in sql_statements:
        url_match = url_pattern.search(sql)
        acl_match = acl_pattern.search(sql)
        
        if url_match and acl_match:
            url = url_match.group(1)
            acl = acl_match.group(1)
            
            print(f"找到 URL: {url}, ACL: {acl}")
            
            # 如果這個 URL 已經存在，添加 ACL 到列表
            if url in url_to_acls:
                url_to_acls[url].append(acl)
            else:
                url_to_acls[url] = [acl]
                url_to_sql[url] = sql
    
    # 生成新的 SQL 語句，合併相同 URL 的 ACL
    merged_sql_statements = []
    for url, acls in url_to_acls.items():
        # 去除重複的 ACL
        unique_acls = list(set(acls))
        
        if len(unique_acls) > 1:
            # 有多個不同的 ACL，需要合併
            merged_acl = ','.join(unique_acls)
            original_sql = url_to_sql[url]
            # 修改替換模式以匹配第三個參數
            merged_sql = re.sub(r"VALUES\s*\(([^,]*,[^,]*),\s*'(ACL[^']*)'", f"VALUES (\\1, '{merged_acl}'", original_sql)
            merged_sql_statements.append(merged_sql)
            print(f"合併 URL: {url}, 合併後 ACL: {merged_acl}")
        else:
            # 只有一個 ACL，保持原樣
            merged_sql_statements.append(url_to_sql[url])
    
    return merged_sql_statements

